func NewStateStore(db ormtable.Schema) (StateStore, error) {
	assertionTable, err := NewAssertionTable(db)
	if err != nil {
		return nil, err
	}

	authenticationTable, err := NewAuthenticationTable(db)
	if err != nil {
		return nil, err
	}

	biscuitTable, err := NewBiscuitTable(db)
	if err != nil {
		return nil, err
	}

	controllerTable, err := NewControllerTable(db)
	if err != nil {
		return nil, err
	}

	grantTable, err := NewGrantTable(db)
	if err != nil {
		return nil, err
	}

	verificationTable, err := NewVerificationTable(db)
	if err != nil {
		return nil, err
	}

	return stateStore{
		assertionTable,
		authenticationTable,
		biscuitTable,
		controllerTable,
		grantTable,
		verificationTable,
	}, nil
}
